import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

import {
  Button,
  ButtonNavigation,
  Gap,
  ListSupplier,
  PageNumber,
} from '../../Component';
import { styContainer, styContainerBottom, styTitle } from './styles';

const Home = () => {
  const [page, setPage] = useState(1);
  const [size, setSize] = useState(2);
  const [data, setData] = useState([]);
  const [totalPages, setTotalPages] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    setData([]);
    axios
      .get(
        `https://mobile.dev.quadrant-si.id/developertest/supplier/inquiry/${page}/${size}`
      )
      .then((res) => {
        setData(res.data.data);
        setTotalPages(res.data.totalPages);
        console.log(res.data);
      });
  }, [page, size]);

  return (
    <div>
      <div className={styContainer}>
        <h1 className={styTitle}>Inventory Management</h1>

        <div>
          {data.map((e, i) => (
            <div key={i}>
              <ListSupplier
                data={e}
                onClick={(e) => {
                  console.log('test');
                  navigate(`/supplier/add`);
                }}
              />
              <Gap height={10} />
            </div>
          ))}
        </div>
        <div className={styContainerBottom}>
          <div>Total Pages : {totalPages}</div>
          <Button type="btn-plus" />
        </div>
        <ButtonNavigation />
      </div>
    </div>
  );
};

export default Home;
